pragma solidity ^0.5.0;

contract MyContract {
    mapping(address => bytes32[]) services;
    mapping(uint => address) addrs;
    mapping(address => bool) hasRegisterd;
    uint curIndex;
    
    
    event Registered(
        address addr,
        bytes32[] service
    );

    constructor() public {
        curIndex = 0;
    }

    function registerService(/*bytes32 name, */bytes memory params) public {
        require(hasRegisterd[msg.sender] != true, "You already registered.");
        bytes32[] memory arrDate = abi.decode(params, (bytes32[]));
        services[msg.sender] = arrDate;
        addrs[curIndex] = msg.sender;
        hasRegisterd[msg.sender] = true;
        curIndex = curIndex + 1;

        emit Registered(msg.sender, arrDate);
    }

    function requestService(bytes memory params) public view returns (address) {
        bytes32[] memory content = abi.decode(params, (bytes32[]));
        address maxAddr;
        uint maxCount = 0;
        uint count;
        address addr;
        
        for(uint i = 0; i < curIndex; i ++) {
            count = 0;
            for(uint j = 0; j < content.length; j ++) {
                addr = addrs[i];
                for(uint k = 0; k < services[addr].length; k ++) {
                    if(services[addr][k] == content[j])
                        count = count + 1;
                }
            }
            if(count >= maxCount) {
                maxCount = count;
                maxAddr = addr;
            }
        }
        return maxAddr;
    }
}
